function rangeHours() {
    let arrHours = []

    for (let i = 1; i<=84; i++) {
        if (1<= i <= 12) {
            arrHours.push(<div>{i}</div>)
        }
        if (13<= i <= 24) {
            arrHours.push(<div>{i}</div>)
        }
        if (25<= i <= 36) {
            arrHours.push(<div>{i}</div>)
        }
        if (37<= i <= 48) {
            arrHours.push(<div>{i}</div>)
        }
        if (49<= i <= 60) {
            arrHours.push(<div>{i}</div>)
        }
        if (61<= i <= 72) {
            arrHours.push(<div>{i}</div>)
        }
        if (1<= i <= 12) {
            arrHours.push(<div>{i}</div>)
        }
    }
    return arrHours
}

export default rangeHours
